description:
Are you ready for the exciting journey in to the jungle of words?

Smart and cute chameleon will be your guide and helpmate all through the way of your wonderful adventure in this extremely interesting world of letters and words.

Great graphics and pleasant sound will give you a feeling of real presence in the green wood filled with different exotic birds and animals.

Combine letters to words and see ancient mechanic locks in action. Game have very big dictionary you will find almost any word there. There are special skills which you will choose after gold levels. Also there are bonuses which makes gameplay different each time you play.

